import Calculator from "./Calculator";
import History from "./History";
import {useState} from 'react';
import {useParams} from 'react-router-dom';

function LoggedIn({calcHistory}) {
    const [historyUpdate, setHistoryUpdate] = useState(false);
    const {id} = useParams();

    return(
        <>
            <Calculator id={id} calcHistory={calcHistory} setHistoryUpdate={setHistoryUpdate}/>
            <History id={id} calcHistory={calcHistory} historyUpdate={historyUpdate}/>
        </>
        // list stuff the user only can see!
    )
}

export default LoggedIn;
